<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Ranks and Rounds Rubric</title>
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap" rel="stylesheet">
  <link href="https://cdn.jsdelivr.net/npm/tailwindcss@2.2.19/dist/tailwind.min.css" rel="stylesheet" onerror="this.onerror=null;this.href='https://unpkg.com/tailwindcss@2.2.19/dist/tailwind.min.css';">
  <style>
    :root {
      --ink: #0f172a;
      --muted: #475569;
      --card: rgba(255, 255, 255, 0.94);
      --border: rgba(15, 23, 42, 0.08);
      --shadow: 0 20px 55px rgba(15, 23, 42, 0.12);
      --accent: #3b82f6;
      --accent-2: #f97316;
    }
    body {
      font-family: 'Inter', system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
      color: var(--ink);
      background:
        radial-gradient(1200px at 18% 8%, rgba(59, 130, 246, 0.15), transparent 42%),
        radial-gradient(1000px at 80% 4%, rgba(249, 115, 22, 0.14), transparent 45%),
        linear-gradient(135deg, #f8fafc 0%, #fff7ed 100%);
      min-height: 100vh;
    }
    .glass {
      background: var(--card);
      border: 1px solid var(--border);
      box-shadow: var(--shadow);
      backdrop-filter: blur(6px);
    }
    .section-title {
      display: inline-flex;
      align-items: center;
      gap: 0.55rem;
      font-weight: 700;
      color: #0f172a;
    }
    .section-title::before {
      content: '';
      width: 26px;
      height: 4px;
      border-radius: 999px;
      background: linear-gradient(120deg, var(--accent), var(--accent-2));
    }
    .pill {
      padding: 0.35rem 0.65rem;
      border-radius: 999px;
      background: #f8fafc;
      border: 1px solid #e2e8f0;
      color: #0f172a;
      font-weight: 600;
      font-size: 0.8rem;
      white-space: nowrap;
    }
    .tag {
      padding: 0.25rem 0.55rem;
      border-radius: 999px;
      font-weight: 600;
      font-size: 0.75rem;
      border: 1px solid #e2e8f0;
      background: #f8fafc;
      color: #0f172a;
    }
    .table-head { background: #f8fafc; }
  </style>
</head>
<body class="pb-14">
  <div class="max-w-screen-2xl mx-auto px-6 py-8 space-y-8">
    <header class="space-y-2">
      <h1 class="text-3xl lg:text-4xl font-bold tracking-tight text-slate-900">Ranks and Rounds Rubric<sup class="text-base font-semibold text-slate-600 align-super">2025</sup></h1>
    </header>

    <section class="glass rounded-3xl p-4 space-y-3">
      <div class="flex flex-col md:flex-row md:items-center md:justify-between gap-3">
        <div class="section-title">Filters</div>
        <div class="flex flex-wrap items-center gap-3 text-sm text-slate-700">
          <div id="selected-entity" class="px-3 py-2 rounded-xl border border-slate-200 bg-blue-50 text-blue-800 text-base font-bold">â€”</div>
          <button id="reset" class="px-4 py-2 rounded-xl border border-slate-200 text-slate-800 font-semibold hover:-translate-y-0.5 transition bg-white">Reset filters</button>
        </div>
      </div>
      <div class="grid gap-3" style="grid-template-columns: repeat(auto-fit, minmax(170px, 1fr));">
        <div>
          <label class="text-xs uppercase tracking-wide text-slate-500">Seat type</label>
          <select id="seat-type" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div>
          <label class="text-xs uppercase tracking-wide text-slate-500">Gender</label>
          <select id="gender" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div>
          <label class="text-xs uppercase tracking-wide text-slate-500">Quota</label>
          <select id="quota" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div id="type-wrap">
          <label class="text-xs uppercase tracking-wide text-slate-500">College type</label>
          <select id="college-type" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div id="branch-filter-wrap" style="min-width: 220px;">
          <label class="text-xs uppercase tracking-wide text-slate-500">Branch (within college)</label>
          <select id="branch-filter" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div id="region-wrap">
          <label class="text-xs uppercase tracking-wide text-slate-500">Region</label>
          <select id="region" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div id="state-wrap">
          <label class="text-xs uppercase tracking-wide text-slate-500">State</label>
          <select id="state" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="All">All</option>
          </select>
        </div>
        <div>
          <label class="text-xs uppercase tracking-wide text-slate-500">Sort by round</label>
          <select id="sort-round" class="w-full rounded-xl border border-slate-200 px-3 py-2 focus:ring-2 focus:ring-blue-400">
            <option value="Close">Close</option>
            <option value="Open">Open</option>
          </select>
        </div>
      </div>
      <div id="summary" class="text-sm text-slate-600 px-1"></div>
    </section>

    <section class="glass rounded-3xl p-6 space-y-4">
      <div class="flex flex-col md:flex-row md:items-center md:justify-between gap-3">
        <div class="section-title">All rounds (open / close)</div>
        <div class="flex items-center gap-3 text-sm text-slate-600">
          <span id="result-count"></span>
          <span id="note" class="text-xs text-slate-600"></span>
        </div>
      </div>
      <div class="rounded-2xl border border-slate-200 bg-white overflow-auto">
        <table class="min-w-full text-sm">
          <thead id="round-head" class="table-head text-left text-slate-600"></thead>
          <tbody id="round-table" class="divide-y divide-slate-100"></tbody>
        </table>
      </div>
    </section>
  </div>

  <script>
    const roundOrder = ['R1','R2','R3','R4','R5','R6','S1','S2','S3'];
    const TYPE_COLORS = {

      entityValue: '',

      gender: 'All',

      'Indian Institute of Carpet Technology, Bhadohi': { state: 'Uttar Pradesh', region: 'North', city: 'Bhadohi' },
      'Indian Institute of Engineering Science and Technology, Shibpur': { state: 'West Bengal', region: 'East', city: 'Shibpur' },

      'Indian Institute of Information Technology, Vadodara International Campus Diu (IIITVICD)': { state: 'Dadra and Nagar Haveli and Daman and Diu', region: 'West', city: 'Diu' },
      'Indian Institute of Information Technology(IIIT) Kottayam': { state: 'Kerala', region: 'South', city: 'Kottayam' },

      'J.K. Institute of Applied Physics & Technology, Department of Electronics & Communication, University of Allahabad- Allahabad': { state: 'Uttar Pradesh', region: 'North', city: 'Prayagraj' },
      'Manipal Institute of Technology, Manipal': { state: 'Karnataka', region: 'South', city: 'Manipal' },
      'National Institute of Electronics and Information Technology, Gorakhpur (UP)': { state: 'Uttar Pradesh', region: 'North', city: 'Gorakhpur' },
      'National Institute of Food Technology Entrepreneurship and Management, Kundli': { state: 'Haryana', region: 'North', city: 'Kundli' },
      'National Institute of Technology, Warangal': { state: 'Telangana', region: 'South', city: 'Warangal' },
      'North-Eastern Hill University, Shillong': { state: 'Meghalaya', region: 'North East', city: 'Shillong' },
      'Pt. Dwarka Prasad Mishra Indian Institute of Information Technology, Design & Manufacture Jabalpur': { state: 'Madhya Pradesh', region: 'Central', city: 'Jabalpur' },
      'Rajiv Gandhi National Aviation University, Fursatganj, Amethi (UP)': { state: 'Uttar Pradesh', region: 'North', city: 'Amethi' },
      'Sant Longowal Institute of Engineering and Technology': { state: 'Punjab', region: 'North', city: 'Longowal' },
      'School of Engineering, Tezpur University, Napaam, Tezpur': { state: 'Assam', region: 'North East', city: 'Tezpur' },
      'School of Studies of Engineering and Technology, Guru Ghasidas Vishwavidyalaya, Bilaspur': { state: 'Chhattisgarh', region: 'Central', city: 'Bilaspur' },
      'Shri Mata Vaishno Devi University, Katra, Jammu & Kashmir': { state: 'Jammu and Kashmir', region: 'North', city: 'Katra' }
    };

    init();

    function init() {
      loadCsv();
      applyQueryParams();
      populateStaticFilters();
      bindEvents();
      updateTable();
    }

    function loadCsv() {
      const text = document.getElementById('embedded-ranks').textContent;
      rows = parseCSV(text);
    }

    function splitCsvLine(line) {
      const out = [];
      let cur = '';
      let inQuotes = false;
      for (let i = 0; i < line.length; i++) {
        const ch = line[i];
        if (ch === '"' && line[i+1] === '"') { cur += '"'; i++; continue; }
        if (ch === '"') { inQuotes = !inQuotes; continue; }
        if (ch === ',' && !inQuotes) { out.push(cur); cur = ''; continue; }
        cur += ch;
      }
      out.push(cur);
      return out;
    }

    function num(v) {
      const n = parseInt((v || '').trim(), 10);
      return Number.isFinite(n) ? n : null;
    }

    function cleanVal(v, fallback='Unknown') {
      const val = (v || '').replace(/^\"+|\"+$/g, '').trim();
      return val || fallback;
    }

    function norm(v) {
      return (v || '').replace(/^\"+|\"+$/g, '').trim().replace(/\s+/g, ' ').toLowerCase();
    }

    function shortType(t) {
      if (t === 'Engineering Institute') return 'EI';
      return t || '';
    }

    function parseCSV(text) {
      const lines = text.trim().split(/\r?\n/);
      const headers = splitCsvLine(lines.shift()).map(h => cleanVal(h, h));
      return lines.map(line => {
        const parts = splitCsvLine(line);
        const obj = {};
        headers.forEach((h, i) => obj[h] = cleanVal(parts[i], ''));
        roundOrder.forEach(r => {
          obj[`${r} Open`] = num(obj[`${r} Open`]);
          obj[`${r} Close`] = num(obj[`${r} Close`]);
        });
        obj.Region = cleanVal(obj.Region);
        obj.State = cleanVal(obj.State);
        obj.City = cleanVal(obj.City);
        obj['College Type'] = cleanVal(obj['College Type'], 'Other');
        obj['Seat Type'] = cleanVal(obj['Seat Type'], 'Unknown');
        obj.Gender = cleanVal(obj.Gender, 'Unknown');
        obj.Quota = cleanVal(obj.Quota, 'Unknown');
        let fix = overrides[obj.College];
        if (!fix) {
          const lower = norm(obj.College);
          const matched = Object.entries(overrides).find(([name]) => lower.includes(norm(name)));
          if (matched) fix = matched[1];
        }
        if (fix) {
          if (fix.state) obj.State = fix.state;
          if (fix.region) obj.Region = fix.region;
          if (fix.city) obj.City = fix.city;
        }
        if ((!obj.Region || obj.Region.toLowerCase() === 'unknown') && obj.State) {
          const guess = stateRegion[obj.State];
          if (guess) obj.Region = guess;
        }
        return obj;
      });
    }

    function populateStaticFilters() {
      const target = norm(filters.entityValue);
      const entityRows = rows.filter(r => filters.entityType === 'college' ? norm(r.College) === target : norm(r.Program) === target);
      if (els.sortFieldSelect) {
        els.sortFieldSelect.value = filters.sortField || 'Close';
      }
      const set = (el, values, formatLabel = (x)=>x) => {
        const opts = ['All', ...Array.from(new Set(values.filter(Boolean))).sort()];
        el.innerHTML = opts.map(o => `<option value="${o}">${formatLabel(o)}</option>`).join('');
        el.value = 'All';
      };
      set(els.seat, entityRows.map(r => r['Seat Type']));
      set(els.gender, entityRows.map(r => r['Gender']));
      set(els.quota, entityRows.map(r => r['Quota']));
      set(els.type, entityRows.map(r => r['College Type']), shortType);
      set(els.region, entityRows.map(r => r['Region']));
      set(els.state, entityRows.map(r => r['State']));
      const branchValues = filters.entityType === 'college'
        ? entityRows.map(r => r.Program)
        : [filters.entityValue];
      set(els.branchFilter, branchValues);
      if (filters.entityType === 'branch') {
        els.branchFilter.value = filters.entityValue;
        els.branchFilter.disabled = true;
      } else {
        els.branchFilter.disabled = false;
        els.branchFilter.value = 'All';
        filters.branch = 'All';
      }
    }

    function bindEvents() {
      [els.seat, els.gender, els.quota, els.type, els.region, els.state, els.branchFilter, els.sortFieldSelect].forEach(el => {
        el.addEventListener('change', () => {
          const map = {
            'seat-type': 'seat',
            'gender': 'gender',
            'quota': 'quota',
            'college-type': 'type',
            'region': 'region',
            'state': 'state',
            'branch-filter': 'branch',
            'sort-round': 'sortField'
          };
          const key = map[el.id] || el.id;
          filters[key] = el.value;
          updateTable();
        });
      });
      if (els.reset) {
        els.reset.addEventListener('click', () => {
          ['seat','gender','quota','type','region','state','branch'].forEach(k => {
            filters[k] = 'All';
            const elMap = { seat: 'seat', gender: 'gender', quota: 'quota', type: 'type', region: 'region', state: 'state', branch: 'branchFilter' };
            const el = els[elMap[k]];
            if (el && !el.disabled) el.value = 'All';
          });
          updateTable();
        });
      }
    }

    function toggleFilterVisibility() {
      if (filters.entityType === 'college') {
        if (els.stateWrap) els.stateWrap.classList.add('hidden');
        if (els.regionWrap) els.regionWrap.classList.add('hidden');
        if (els.branchWrap) els.branchWrap.classList.remove('hidden');
        if (els.typeWrap) els.typeWrap.classList.add('hidden');
      } else {
        if (els.stateWrap) els.stateWrap.classList.remove('hidden');
        if (els.regionWrap) els.regionWrap.classList.remove('hidden');
        if (els.branchWrap) els.branchWrap.classList.add('hidden');
        if (els.typeWrap) els.typeWrap.classList.remove('hidden');
      }
    }

    function buildHead(roundsArr = roundOrder) {
      if (!els.head) return;
      const rounds = roundsArr.map(r => {
        const arrow = r === sortRoundColumn ? (sortDirection === 'asc' ? ' â†‘' : ' â†“') : '';
        return `<th class="px-3 py-2 text-right cursor-pointer ${r === sortRoundColumn ? 'font-semibold' : ''}" data-round="${r}">${r} O/C${arrow}</th>`;
      }).join('');
      els.head.innerHTML = `
        <tr>
          ${filters.entityType === 'branch' ? '<th class="px-3 py-2">College</th>' : ''}
          ${filters.entityType === 'college' ? '<th class="px-3 py-2">Branch</th>' : ''}
          <th class="px-3 py-2">Seat</th>
          <th class="px-3 py-2">Gender</th>
          <th class="px-3 py-2">Quota</th>
          ${rounds}
        </tr>
      `;
    }

    function applyQueryParams() {
      const params = new URLSearchParams(window.location.search);
      const type = params.get('type');
      const value = params.get('value');
      if (type === 'branch' || type === 'college') {
        filters.entityType = type;
        filters.entityValue = cleanVal(decodeURIComponent(value || ''), '');
      }
      els.selected.textContent = filters.entityValue || 'No input';
      toggleFilterVisibility();
    }

    function shortenCollege(name) {
      const n = name || '';
      if (n.startsWith('Indian Institute of Technology')) return 'IIT ' + n.replace('Indian Institute of Technology','').trim();
      if (n.startsWith('Indian Institute of Information Technology')) return 'IIIT ' + n.replace('Indian Institute of Information Technology','').trim();
      if (n.startsWith('National Institute of Technology')) return 'NIT ' + n.replace('National Institute of Technology','').trim();
      return n;
    }

    function shortGender(g) {
      if (g === 'Female-only (including Supernumerary)') return 'F';
      if (g === 'Gender-Neutral') return 'G';
      return g || '';
    }

    function passesFilters(r) {
      if (!filters.entityType || !filters.entityValue) return false;
      const target = norm(filters.entityValue);
      if (filters.entityType === 'college') {
        if (norm(r.College) !== target) return false;
        if (filters.branch !== 'All' && r.Program !== filters.branch) return false;
      } else {
        if (norm(r.Program) !== target) return false;
      }
      if (filters.seat !== 'All' && r['Seat Type'] !== filters.seat) return false;
      if (filters.gender !== 'All' && r.Gender !== filters.gender) return false;
      if (filters.quota !== 'All' && r.Quota !== filters.quota) return false;
      if (filters.type !== 'All' && r['College Type'] !== filters.type) return false;
      if (filters.region !== 'All' && r.Region !== filters.region) return false;
      if (filters.state !== 'All' && r.State !== filters.state) return false;
      return true;
    }

    function updateTable() {
      const target = norm(filters.entityValue);
      const baseRows = rows.filter(r => filters.entityType === 'college' ? norm(r.College) === target : norm(r.Program) === target);
      if (!baseRows.length) {
        const baseCols = filters.entityType ? 4 : 5;
        const colCount = baseCols + roundOrder.length;
        els.summary.textContent = 'No rows for the selected college/branch.';
        if (els.note) els.note.textContent = '';
        if (els.resultCount) els.resultCount.textContent = '';
        els.table.innerHTML = `<tr><td colspan="${colCount}" class="px-3 py-3 text-slate-500 text-sm">No rows.</td></tr>`;
        return;
      }
      const isIIT = filters.entityType === 'college' && baseRows[0]['College Type'] === 'IIT';
      const roundsUsed = isIIT ? roundOrder.filter(r => !r.startsWith('S')) : roundOrder;
      buildHead(roundsUsed);

      const data = baseRows.filter(passesFilters);
      const note = isIIT ? 'No Special rounds for IIT.' : '';
      if (els.note) els.note.textContent = note;
      if (els.resultCount) els.resultCount.textContent = data.length ? `Rows: ${data.length} â€¢ Sort: ${sortRoundColumn} ${filters.sortField} (${sortDirection})` : '';
      els.summary.textContent = '';
      if (!data.length) {
        const baseCols = filters.entityType ? 4 : 5;
        const colCount = baseCols + roundsUsed.length;
        els.table.innerHTML = `<tr><td colspan="${colCount}" class="px-3 py-3 text-slate-500 text-sm">No rows.</td></tr>`;
        return;
      }
      if (!roundsUsed.includes(sortRoundColumn)) sortRoundColumn = roundsUsed[roundsUsed.length - 1];
      const sortField = filters.sortField === 'Open' ? 'Open' : 'Close';
      const sorted = data.slice().sort((a,b) => {
        const av = a[`${sortRoundColumn} ${sortField}`] ?? Number.POSITIVE_INFINITY;
        const bv = b[`${sortRoundColumn} ${sortField}`] ?? Number.POSITIVE_INFINITY;
        if (av !== bv) return sortDirection === 'asc' ? av - bv : bv - av;
        return a.Program.localeCompare(b.Program);
      });
      els.table.innerHTML = sorted.map(r => `
        <tr class="hover:bg-slate-50 transition">
          ${filters.entityType === 'branch' ? `<td class="px-3 py-2 font-semibold text-slate-900">${shortenCollege(r.College)}</td>` : ''}
          ${filters.entityType === 'college' ? `<td class="px-3 py-2 text-slate-700">${r.Program}</td>` : ''}
          <td class="px-3 py-2">${r['Seat Type']}</td>
          <td class="px-3 py-2">${shortGender(r.Gender)}</td>
          <td class="px-3 py-2">${r.Quota}</td>
          ${roundsUsed.map(rn => {
            const open = r[`${rn} Open`] ?? 'â€”';
            const close = r[`${rn} Close`] ?? 'â€”';
            return `<td class="px-3 py-2 text-right sortable" data-round="${rn}">${open} / ${close}</td>`;
          }).join('')}
        </tr>
      `).join('');
      // clickable sorting
      if (els.head) {
        els.head.querySelectorAll('th[data-round]').forEach(th => {
          th.addEventListener('click', () => {
            const round = th.getAttribute('data-round');
            if (round === sortRoundColumn) {
              sortDirection = sortDirection === 'asc' ? 'desc' : 'asc';
            } else {
              sortRoundColumn = round;
              sortDirection = 'asc';
            }
            updateTable();
          });
        });
      }
    }
  </script>
</body>
</html>
